6.Description:
เมื่อปล่อย <color=#FFFFFF>[สกิลพิเศษ-EX]</color>, <color=#FFFFFF>[สกิลต่อเนื่อง]</color>
หรือ <color=#FFFFFF>[สกิลอัลติเมท]</color> "Soldier 11" จะได้รับ Charge 8 ชั้น (สูงสุด 8 ชั้น);
เมื่อทำให้เกิด <color=#FFFFFF>[Fire Suppression]</color> จะใช้ Charge 1 ชั้น เพื่อทำให้การโจมตีในขณะนั้น มองข้าม 25% ของ<color=#FF5521>ความต้านทานความเสียหายไฟ</color>ของเป้าหมาย

104100002.Description:
กด <IconMap:Icon_Normal> ในช่วงเวลาที่เหมาะสม;
จะทำการ Slash ที่รุนแรงยิ่งขึ้น
เพื่อสร้าง<color=#FF5521>ความเสียหายธาตุไฟ</color>

104100005.Description:
กด <IconMap:Icon_Evade> เพื่อ
พุ่งหลบอย่างรวดเร็ว;
ขณะที่ใช้ท่านี้ จะมีเอฟเฟกต์ Invulnerable

104100013.Description:
เมื่อตัวละครที่อยู่ในสนาม กำลังจะถูกโจมตี กด <IconMap:Icon_Switch> เพื่อ
ตั้งรับการโจมตีของศัตรู และสะสม Daze ปริมาณมาก;
ขณะที่ใช้ท่านี้ จะมีเอฟเฟกต์ Invulnerable

104100014.Description:
หลังจากใช้ <color=#FFFFFF>[ซัปพอร์ตตั้งรับ]</color> กด <IconMap:Icon_Normal> เพื่อ
ใช้ Cross Slash ใส่ศัตรูที่อยู่ข้างหน้า เพื่อสร้าง<color=#FF5521>ความเสียหายธาตุไฟ</color>;
ขณะที่ใช้ท่านี้ จะมีเอฟเฟกต์ Invulnerable
